VALUES ('7611466211478', 'choco kids', 'Cacahuètes 48%, Chocolat 32%: Sucre, masse de cacao, beurre de cacao, lait écrémé en poudre, beurre concentré, lactosérum en poudre, émulsifiants (lécithine de soja, E476), arôme naturel de vanille. Peut contenir das traces de noisettes, fruits à coque, gluten. Cacao 25% min.  Caran eis 4,5%: lait condensé sucré 31% (lait entier concentré, sucre, stabilisant [E329]), sucre, sirop de glucose, lait entier en poudre 6,4%, huile de palme, humectant (E420), crème entière 3%, beurre 1%, sel de cuisine, émulsifiant (E471). Sucette 4%: Sucre, sirop de glucose (traces de blé), acidifiant (E330), arômes, colorant: (E150a, E150c, E100). Chocolats 4%: sucre, beurre de cacao, lait entier en poudre, pâte de cacao, lait écrémé en poudre, pâte de noisette, émulsifiant (lécithine de soja), arôme naturel. Peut contenir des traces de gluten, amandes. Bonbon 3,5%: Sirop de glucose, sucre, huile de coco, gélatine (poro), acidifiant (E330), concentré de jus de fruits (fran boise, ananas, citron, orange), arômes, colorants (E160a, E163). Article de confiserie avec du caramel &gt;Caranbar caramel&gt; 2,5%: Sirop de glucose, lait écrémé concentré sucré, sucre, huile de coprah totalement hydrogénée, cacao maigre en poudre, sel, arôme artificial. Peut contenir des traces de noisettes. Biscuits 1,5%: Sucre, farine de blé, miel, écorce de citron, oranges confites, poudres à  lever (E500ii, E330, huile es: entielle de citron, arôme naturel.', 'https://static.openfoodfacts.org/images/products/761/146/621/1478/front_fr.9.400.jpg', '', '', '', '', '', '', '', '', '', '1');

