INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('7611596001000', 'Club Sandwich jambon', 'Pain spécial 50% (eau, farine de froment, beurre, levure, lait écrémé en poudre, améliorant de panification (amidon de blé, farine de blé prégélatinisée, gluten de blé, acérola en poudre, enzymes), sel sucre), jambon de derrière 30% (viande de porc, eau, sel nitrité pour saumule (sel de cuisine, conservateur e250), stabilisants [e450, e451], sirop de glucose, dextrose, sucre, épices, exhausteur de goût [gluramat, monosodique], antioxydants [acide ascorbique, e301]), préparation à la moutarde 20% (eau, vinaigre de table, graisse de palme (rspo segregated), moutarde 6%, jus de carottes, sel de cuisine, jaune d\'œuf (ponte au sol), épaississants (amidon modifié de maïs, gomme de xanthane, farine de graines de gar), protéines de lait, sucre, dextrose, acide citrique, épices, extraits d\'épices). peut contenir des traces de poisson, noisettes, céleri, soja, sulfites.', 'https://static.openfoodfacts.org/images/products/761/159/600/1000/front_fr.5.400.jpg', '7', '', '31', '', '', '11', '1.8', '0.708661417322835', '', '0');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('7611596002403', 'Tortillas Sandwich Chorizos-Salsa', 'Pâte 40% (farine de blé, eau, huile de colza, sel de cuisine, émulsifiants [E472e, E471], poudre à lever [E500, E450], sucre, acide malique, ac de citrique), salami chorizos 15% (viande de porc [Suisse], lard, couenne, sel nitrité [sel de cuisine, conservateur E], maltodextrine, glucose, paprika, épices, antioxydants [E301, E304]), œufs cuits d\'élevage au sol 12%, mayonnaise 12% (huile de tournesol, jaune d\'œufs (élevage au sol, vinaigre d\'eau de vie, eau, sel de cuisine, moutarde, épaississant [E412, E415], acidifiant [E331], extrait de polvere), préparation aux légumes 12% (tomate, oignons, eau, maïs, piments, Jalapenos, poivrons rouges, sel, arômes (contient du gluten et de celeris), ail, antioxydant [E300], concentré de citron, paprika), poivrons verts 9%. Peut contenir des traces de crustacés, soja, lait, sulfites.', 'https://static.openfoodfacts.org/images/products/761/159/600/2403/front_fr.12.400.jpg', '17', '', '30', '', '', '12', '', '', '', '1');

