INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('7611596002434', 'Tortillas Sandwich avec une farce aux crevettes', 'Pâte 37% (farine d blé, eau, huile de purée de tomate, sel de cuisine, émulsifiants [E 472e, E471], poudre à lever [E500, E450], sucre, acide malique, acide citrique), crevettes cuites 47% (Canada)(Crevettes [Pandalus Borealis], 90% [peche, Atlantique Nord], eau, sel de cuisine), celeris 17% (celeris, eau, vinaigre de table, sel de cuisine, sucre, acidifiant [E330], antioxydants [E300, [dissulfite de potassium, E224]], exhausteur de goût [glutamate de sodium]), sauce cocktail 11% (mayonnaise 57% [huile de tournesol, jaune d\'œufs [élevage au sol], vinaigre d\'eau de vie, eau, sel de cuisine, moutarde, épaississant [E412, E415], acidifiant [E331], extrait de poivre, préparation à la tomate 21% [concentré de tomates, eau, vinaigre de table, sucre, épaississant [amidon de maïs modifié, E412, E415], sel de cuisine, extrait d\'épices, arômes naturels], sere maigre 14%, jus de citron à base de concentré 3% [avec dissulfite de potassium E224], paprika doux condiment en poudre [avec celeris], piments], préparation aux légumes 11% (tomate, oignons, eau, sucre, vinaigre de table, amidon modifié de maïs, piments Jalapenos, poivrons rouges, sel de cuisine, arômes [contient du gluten et edu celeris], ail, antioxydant [E300], concentré de citron, paprika), ananas 7% (ananas en cubes, jus d\'ananas, antioxydant [E300]). Peut contenir des traces de soja.', 'https://static.openfoodfacts.org/images/products/761/159/600/2434/front_fr.12.400.jpg', '10', '', '32', '', '', '10', '', '', '', '1');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('7611596002502', 'Barbey Polar Sandwich Mozarella-Salami piquant', 'Pain spécial 42% (farine de blé, farine de seigle, eau, mélasse [issu du sucre de betterae], levain de seigle, levure, sucre, margarine végétale [huile de colza, eau, sel, E471]), gluten de blé poudre à lever (E503), sel, émulsifiants (E471, E172e), acide ascorbique et enzymes), mozzarella 35%, préparation au pesto 13% (mayonnaise 47% [huile de tournesol, jaune d\'œufs, vinaigre d\'eau de vie, eau, sel de cuisine, moutarde, épaississant [E412, E415], acidifiant [E331], extrait de poivre), sauce pesto 47% (Semi-préparation au basilic [basilic 90%, huile de tournesol, fromage ricotta, granan padano D.O.P [avec protéines naturelles d\'albumine d\'œuf], huile d\'olive extra vierge, noix de cajoux, lait en poudre, pignons de pin, fibre végétale, sel de cuisine, ail, antioxydant [E300], acidifiant [E270]), salami piquant 10% (viande de porc [Suisse], lard, couenne, sel nitrité [sel de cuisine, conservateur E250], maltodextrine, glucose, paprika, épices, antioxydants [E301, E304]). Peut contenir des traces de poisson, de soja, de céleris, de sulfites.', 'https://static.openfoodfacts.org/images/products/761/159/600/2502/front_fr.10.400.jpg', '25', '', '20', '', '', '12', '', '', '', '1');

INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('7611596002519', 'Barbey Sandwich Polar Thon - Olives', 'Pains spécial 35% (farine de ble, farine de seigle, eau, mélasse [issu du sucre de betterave) levain de seigle, levure, sucre, margarine végétale [huile de colza, eau, sel , e471:), gluten de ble, poudre à lever [e503], sel, émulsifiants [e471, e472e], acide ascorbique et enzymes), thon 30%, [thaïlande] (thon rosé [katsuwonus pelamis, océan pacifique et indien, pêche), huile de tournesol, sel de cuisine), préparation au citron 18% (mayonnaise 93% (huile de tournesol, jaune d\'oeufs (ponte au sol), vinaigre d\'eau de vie, eau, sel de cuisine, moutarde, épaississant [e412, e415], acidifiant [e331], extrait de poivre), jus de citron à base de concentré 5% (conservé avec [e202]), stabilisant (pectine), antioxydant [dissulfite de potassium e224), arôme citron 2%), oeufs cuits d\'élevage au sol 12%, olives vertes 5% (olives vertes, eau, sel de cuisine, acidifiants: acide lactique, acide citrique). peut contenir des traces de soja, lait, noix de cajou, céleris.', '', '19', '', '15', '', '', '12', '', '', '', '1');

